import { Logo, BurgerIcon, ListIcon, ProfileIcon } from "@ya.praktikum/react-developer-burger-ui-components";
import s from './app-header.module.css';

export default function AppHeader() {

  const menuTextClassNames = "text text_type_main-default ml-2";
  const menuMargin = "mt-4 mr-5 mb-4 ml-5";

  return (
    <header className={s.header}>
        <nav className={s.content}>
            <div className={s.navigation}>
                <a className={`${s.navigation__link} ${s.active}`}>
                    <BurgerIcon type="primary"/>
                    <p className={s.text_type_main_small}>Конструктор</p>
                </a>
                <a className={`${s.navigation__link} ${s.active}`}>
                    <ListIcon type="primary"/>
                    <p className={s.text_type_main_small}>Лента заказов</p>
                </a>
            </div>
            <Logo />
            <a className={`${s.navigation__link} ${s.inactive}`}>
                <ProfileIcon type="primary"/>
                <p className={s.text_type_main_small}>Личный кабинет</p>
            </a>
        </nav>
    </header>
  );

}
